import React from 'react';
import './styles.css'

interface Transaction {
    transaction_id: string;
    account_id: string;
    amount: number;
    created_at: string;
  }

  interface TransactionListProps {
    transactions: Transaction[]; // Make sure it matches the structure of your API response
    balance: number;
  }

  const TransactionList: React.FC<TransactionListProps> = ({ transactions, balance }) => {
    return (
      <div>
        <h2>Transaction List</h2>
        <ul>
          {transactions.map((transaction) => (
            <li key={transaction.transaction_id}>
              Account: {transaction.account_id}, Amount: {transaction.amount}, Created At: {transaction.created_at}
            </li>
          ))}
        </ul>
        <p>Current Balance: {balance}</p>
      </div>
    );
  };

export default TransactionList;
